import React, { Component } from 'react';
import axios from 'axios';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

class Vereine2 extends Component {
  state = {
    data: [],
    loading: true,
    error: null,
  };

  componentDidMount() {
    axios.get('http://localhost:8080/verein') // Replace with your Spring Boot API endpoint
      .then(response => {
        this.setState({
          data: response.data,
          loading: false,
          error: null,
        });
      })
      .catch(error => {
        this.setState({
          data: [],
          loading: false,
          error: 'An error occurred while fetching data.',
        });
      });
  }

  render() {
    const { data, loading, error } = this.state;

    if (loading) {
      return <div>Loading...</div>;
    }

    if (error) {
      return <div>Error: {error}</div>;
    }

    return (
      <div>
        <h1>Fetched Data:</h1>
        <DataTable value={data}>
          <Column field="id" header="ID"></Column>
                <Column field="name" header="Name"></Column>
                <Column field="abk" header="Ab"></Column>
          {/* Add more columns for other properties */}
        </DataTable>
      </div>
    );
  }
}

export default Vereine2;
